import cls from 'classnames'

function BudgetNumber({
  type,
}) {
  
  let budgetNumberClass = cls({
    'budget__income': type == 'inc',
    'budget__expenses': type == exp,
  })

  return (
    <div className={budgetNumberClass}>
      <div className="budget__income--text">{budgetNumberClass}</div>
      <div className="right">
        <div className="budget__income--value">+ 4,300.00</div>
        <div className="budget__income--percentage">45%</div>
      </div>
    </div>
  )
}

export default BudgetNumber
